import React, { useEffect, useState } from "react";
import Navbar from "./Navbar";
import axios from "axios";
import ImgCard from "./cardTemp";

export default function WishList(){
    const [coin,setCoin]=useState([]);
    const [int1,setInt1]=useState('');
    const [int2,setInt2]=useState('');
    const [int3,setInt3]=useState('');
    const [int4,setInt4]=useState('');

    useEffect(()=>{
        fetch("http://localhost:8000/success-log",{
            method: "POST",
            headers:{
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                token:window.localStorage.getItem("token")
            })

        })
        .then((res)=>res.json())
        .then((data)=>{
            setInt1(data.data.int1);
            setInt2(data.data.int2);
            setInt3(data.data.int3);
            setInt4(data.data.int4);
        });

    })
    useEffect(() => {
        const url = 'https://api.coingecko.com/api/v3/coins/markets?vs_currency=usd&order=market_cap_desc&per_page=50&page=1&sparkline=false'
        axios.get(url).then(
            (res) => { setCoin(res.data) }
                      
        )
    }, [])
 
    const coinData1=coin.filter((data)=>{

        return(data.name===int1);
    });

    return(
        <>
        <Navbar/>
                <h3>Cryptocurrencies of your Interest</h3>
            <div className="grid-container">
                    {<ImgCard
                        name={coinData1.name} rank={coinData1.market_cap_rank} price={coinData1.current_price}
                        marketCap={coinData1.market_cap} key={coinData1.id} url={coinData1.image}
                    />
                    }
                    {console.log(coinData1.data)}
            </div>
        </>
    )
}
